contracts/DecentraGovernor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/governance/Governor.sol";
import "@openzeppelin/contracts/governance/extensions/GovernorCountingSimple.sol";
import "@openzeppelin/contracts/governance/extensions/GovernorVotes.sol";

contract DecentraGovernor is Governor, GovernorCountingSimple, GovernorVotes {
    constructor(IVotes token)
        Governor("DecentraGovernor")
        GovernorVotes(token)
    {}

    function votingDelay() public pure override returns (uint256) {
        return 1;
    }
    function votingPeriod() public pure override returns (uint256) {
        return 45818; // ~1 week
    }

    function proposalThreshold() public pure override returns (uint256) {
        return 0;
    }

    function quorum(uint256) public pure override returns (uint256) {
        return 1;
    }
}

contracts/ExecutorModule.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IGnosisSafe {
    function execTransaction(
        address to,
        uint256 value,
        bytes calldata data,
        uint8 operation,
        uint256 safeTxGas,
        uint256 baseGas,
        uint256 gasPrice,
        address gasToken,
        address refundReceiver,
        bytes calldata signatures
    ) external returns (bool success);
}

contract ExecutorModule {
    IGnosisSafe public safe;

    constructor(address _safe) {
        safe = IGnosisSafe(_safe);
    }

    function execute(
        address to,
        uint256 value,
        bytes calldata data,
        bytes calldata signatures
    ) external {
        // All parameters needed for execTransaction must be provided
        safe.execTransaction(
            to,
            value,
            data,
            0,              // operation: 0 = CALL
            0,              // safeTxGas: set to 0, Safe estimates gas
            0,              // baseGas: usually 0
            0,              // gasPrice: usually 0 (Safe gas estimation)
            address(0),     // gasToken: set zero for ETH
            address(0),     // refundReceiver
            signatures      // concatenated owner signatures
        );
    }
}

contracts/ProposalRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract ProposalRegistry {
    struct Proposal {
        uint256 id;
        address proposer;
        string hash;
        bool executed;
    }
    mapping(uint256 => Proposal) public proposals;
    uint256 public nextId;

    function register(string calldata hash) external returns (uint256) {
        proposals[nextId] = Proposal(nextId, msg.sender, hash, false);
        return nextId++;
    }

    function markExecuted(uint256 id) external {
        proposals[id].executed = true;
    }
}

